SURPRISE!!! REVIVAL DROP IS LIVE!!! Link in bio at ygtfreerunning.com! 😁

If you wondered "Did YGT Freerunning die in 2020??" then congratulations you were right! The team was officially disbanded and thought to never see the light of day again... until 2022 after hearing the stories of many athletes who only continued Parkour because of our silly team, we decided the world would be much better with us in it despite our flaws.

We have learned a lot since being clueless 15 year-olds, so we moved on from using crappy polyester shirts and the convenient-yet infamous Redbubble website. The YGT Representative v2.0 is actually a design we planned since 2017 but we never got to making it. We still have a long way to go but we believe we are rebooting this team for the right reasons. Thank you all for your support and stay tuned for our next big video coming out after Easter! 🙌

